INSERT INTO `frontend_article` VALUES ('1', '1', '0', '2015-03-07 04:47:12', 'dinamicheskie_shabloni_django', 'django_dynamic_templates', 'Динамические шаблоны в Django', 'Dynamic templates', '\r\nВсем привет.<br/>\r\nСегодня я покажу как загружать шаблоны из базы данных. Это весьма полезная фича, если на этапе разработки сайта \r\nнадо часто вносить правки в шаблоны и демонстрировать результат клиенту.<br/>\r\nВсе шаблоны в `Djnago` загружаются с помощью вызова `get_template`, который перебирает лоадеры, указанные в \r\n`settings.TEMPLATE_LOADERS`.<br/>\r\nВ первоначальном проекте эта настройка отсутствует и берется из настроек `Django` по умолчанию:\r\n\r\n    :::python\r\n    TEMPLATE_LOADERS = (\'django.template.loaders.filesystem.Loader\',\r\n                         \'django.template.loaders.app_directories.Loader\')\r\n    \r\n     \r\n \r\nПервый лоадер ищет совпадение в папках указанных в `settings.TEMPLATE_DIRS`. \r\nВторой перебирает все аппы, которые указаны в `settings.INSTALLED_APPS` и ищет шаблоны в `templates` папках.\r\n\r\n***Ахтунг!*** Порядок в списке важен, если с помощью первого лоадера будет найден шаблон, то второй лоадер уже не будет вызываться.\r\n\r\nИтак, для того чтобы шаблоны подгружались из БД создадим свой лоадер.<br/> \r\nСначала создадим модель:\r\n\r\n    :::python\r\n    # models.py\r\n    from django.db import models\r\n    from django.utils.translation import ugettext_lazy as _\r\n    \r\n    class Template(models.Model):\r\n        name = models.CharField(verbose_name=_(\'name\'), max_length=255)\r\n        content = models.TextField(verbose_name=_(\'content\'))\r\n        status = models.BooleanField(verbose_name=_(\'status\'), default=False)\r\n    \r\n        class Meta:\r\n            verbose_name = _(\'template\')\r\n            verbose_name_plural = _(\'templates\')\r\n            \r\nНе забываем сразу кодить с учетом поддержки языков. <br/>\r\nТеперь создадим лоадер:\r\n\r\n    :::python\r\n    # loaders.py\r\n    class Loader(BaseLoader):\r\n        is_usable = True\r\n    \r\n        def load_template_source(self, template_name, template_dirs=None):\r\n            try:\r\n                template = Template.objects.get(name=template_name, status=True)\r\n                return template.content, None\r\n            except BaseException, e:\r\n                raise TemplateDoesNotExist, \'Cant find template in DB - %s\' % e\r\n    \r\n    \r\n        load_template_source.is_usable = True    \r\n        \r\nдобавляем в `settings.TEMPLATE_LOADERS` наш лоадер:\r\n\r\n    :::python\r\n    # settings.py\r\n    TEMPLATE_LOADERS = (\'frontend.loaders.Loader\',\r\n                        \'django.template.loaders.filesystem.Loader\',\r\n                        \'django.template.loaders.app_directories.Loader\')\r\n    \r\n        \r\nну и код во `views.py`:\r\n\r\n    :::python\r\n    # views.py\r\n    from django.views.generic import TemplateView\r\n    \r\n    class IndexView(TemplateView):\r\n        template_name = \'frontend/index_view.html\'\r\n        \r\nа также создаем 2 шаблона. 1-й в базе с `name=frontend/index_view.html`: \r\n\r\n    :::html\r\n    {% extends \'base.html\' %}\r\n    {% block content %}<h1>Hello from db-template</h1>{% endblock %}\r\n    \r\n2-й в аппе frontend в папке `templates/frontend/index_view.html`:\r\n\r\n    :::html\r\n    {% extends \'base.html\' %}\r\n    {% block content %}<h1>Hello from default template</h1>{% endblock %}\r\n    \r\n    \r\nНа этом, собственно, все. Тыркаем `status` в админке - смотрим как подгружаются шаблоны из базы и из проекта.\r\n\r\nНу и исходники примера - <a href=\"https://github.com/vaad2/lesson_3\" target=\"_blank\">тыркаем</a> сверху.\r\n\r\nPeace!\r\n\r\n            \r\n \r\n\r\n\r\n   ', 'Аглицкий контент.\r\n\r\n    :::python\r\n    def jopa:\r\n        print \'okk page\'\r\n    ', '1', '1', 'Аглицкий контент.\r\n:::python\r\ndef jopa:\r\n    print \'okk page\'\r\n', 'Всем привет.<br/>\r\nСегодня я покажу как загружать шаблоны из базы данных. Это весьма полезная фича, если на этапе разработки сайта \r\nнадо часто вносить правки в шаблоны и демонстрировать результат клиенту.<br/>\r\nВсе шаблоны в `Djnago` загружаются с помощью вызова `get_template`, который перебирает лоадеры, указанные в \r\n`settings.TEMPLATE_LOADERS`.<br/>\r\nВ первоначальном проекте эта настройка отсутствует и берется из настроек `Django` по умолчанию:', 'https://github.com/vaad2/lesson_3');
INSERT INTO `frontend_article` VALUES ('5', '1', '0', '2015-03-10 01:05:21', 'neskolko_adminok_django', 'django_multiple_admin', 'Несколько админок в django', 'Django multiple admin', 'Здоровья всем!\r\nВозьмем следующую задачу: необходимо сделать сайт газеты. \r\nНа сайте присутствуют следующие роли:\r\n\r\n* автор - может писать статьи, но не видит статьи других авторов.\r\n* редактор - может редактировать статьи авторов.\r\n* суперадмин - делает все.\r\n\r\nСоздадим модельку для статей:\r\n\r\n    :::python\r\n    # models.py\r\n    from django.contrib.auth.models import User\r\n    from django.db import models\r\n    from django.utils.translation import ugettext_lazy as _\r\n    \r\n    \r\n    class Template(models.Model):\r\n        name = models.CharField(verbose_name=_(\'name\'), max_length=255)\r\n        content = models.TextField(verbose_name=_(\'content\'))\r\n        status = models.BooleanField(verbose_name=_(\'status\'), default=False)\r\n    \r\n        class Meta:\r\n            verbose_name = _(\'template\')\r\n            verbose_name_plural = _(\'templates\')\r\n    \r\n    \r\n    class Article(models.Model):\r\n        user = models.ForeignKey(User, verbose_name=_(\'user\'))\r\n        title = models.CharField(verbose_name=_(\'title\'), max_length=255)\r\n        content = models.TextField(verbose_name=_(\'content\'))\r\n    \r\n        def __unicode__(self):\r\n            return self.title\r\n    \r\n        class Meta:\r\n            verbose_name = _(\'article\')\r\n            verbose_name_plural = _(\'articles\')\r\n        \r\nОдно из решений задачи - под каждую роль сделать свою админку. <br/>\r\nКогда мы используем admin.site - на самом деле мы вызываем админку по умолчанию, если зарыться немного глубже в исходники Django, мы увидим \r\nчто `site=AdminSite()`. Создадим админку для суперадмина:\r\n    \r\n    :::python\r\n    # admin.py\r\n    from django.contrib import admin\r\n    from django.contrib.admin.sites import AdminSite\r\n    from django.contrib.auth.admin import GroupAdmin, UserAdmin\r\n    from django.contrib.auth.models import Group, User\r\n    \r\n    from .models import Template, Article\r\n    \r\n    \r\n    class SuperAdminSite(AdminSite):\r\n        def has_permission(self, request):\r\n            return request.user.is_superuser and request.user.is_active and request.user.is_staff\r\n            # return request.user.is_active and request.user.is_staff\r\n    \r\n    \r\n    admin_super = SuperAdminSite(name=\'admin_super\')\r\n    \r\n    admin_super.register(Group, GroupAdmin)\r\n    admin_super.register(User, UserAdmin)\r\n    \r\n    admin_super.register(Template, list_display=[\'id\', \'name\', \'status\'],\r\n        list_editable=[\'name\', \'status\'])\r\n    admin_super.register(Article, list_display=[\'id\', \'user\', \'title\'],\r\n        list_editable=[\'user\', \'title\'])\r\n \r\n    \r\nПереопределяя метод `has_permission` мы отсеиваем всех пользователей, которые не суперадмины. Т.к. стандартная админка снесена (та что в `admin.site`)\r\nнужно повторно зарегистрировать `GroupAdmin`, `UserAdmin`. \r\n\r\nДелаем админку для авторов и редакторов:\r\n\r\n    :::python\r\n    ...\r\n    class EditorAdminSite(AdminSite):\r\n        def has_permission(self, request):\r\n            return request.user.groups.filter(\r\n                Q(name=\'editor\') | Q(name=\'super_editor\')).exists() and \\\r\n                   request.user.is_active and request.user.is_staff\r\n    \r\n    \r\n    class AdminEditortMixin(admin.ModelAdmin):\r\n        exclude = [\'user\']\r\n    \r\n        def get_queryset(self, request):\r\n            qset = super(AdminEditortMixin, self).queryset(request)\r\n    \r\n            if request.user.groups.filter(name=\'super_editor\').exists():\r\n                return qset\r\n    \r\n            return qset.filter(user=request.user)\r\n    \r\n    \r\n    class ArticleAdmin(AdminEditortMixin, admin.ModelAdmin):\r\n        def save_model(self, request, obj, form, change):\r\n            obj.user = request.user\r\n            obj.save()\r\n    \r\n    \r\n    admin_editor = EditorAdminSite(name=\'admin_editor\')\r\n    \r\n    admin_editor.register(Article, ArticleAdmin)\r\n    \r\n***Ахтунг!!!*** Для того чтобы работали именованные ссылки для админок - задаем `name=\'admin_super\'` и `name=\'admin_editor\'`, \r\nв данном случае `name=namespace`.<br/> \r\n\r\nДобавим ссылки в `urls`:\r\n\r\n    :::python\r\n    # urls.py\r\n    from django.conf.urls import patterns, include, url\r\n    from frontend import admin\r\n    \r\n    \r\n    urlpatterns = patterns(\'\',\r\n        url(r\'^admin/\', include(admin.admin_super.urls)),\r\n        url(r\'^editor/\', include(admin.admin_editor.urls)),\r\n    \r\n        url(r\'\', include(\'frontend.urls\', namespace=\'frontend\')),\r\n    )\r\n\r\nТ.е. для того чтобы получить ссылки на вход в админку редактора пишем `reverse(\'admin_super:index\')` или в шаблоне `{% url \'admin_super:index\' %}`, \r\nсуперадмина - `reverse(\'admin_client:index\')` или в шаблоне `{% url \'admin_client:index\' %}`.\r\n\r\nСоздадим суперадмином роли `editor` и `super_editor` - дадим им все права. Для роли `editor` создадим пользователей `editor_1` и `editor_2` и \r\nдля роли `super_editor` - `seditor` и выставляем статус персонала. Устанавливаем пароли для всех - `1`\r\n', '', '1', '1', '', 'Здоровья всем!\r\nВозьмем следующую задачу: необходимо сделать сайт газеты. \r\nНа сайте присутсвуют следующие роли:\r\n\r\n* автор - может писать статьи, но не видит статьи других авторов.\r\n* редактор - может редактаривать статьи авторов.\r\n* суперадмин - делает все.', 'https://github.com/vaad2/lesson_4');
INSERT INTO `frontend_article` VALUES ('6', '1', '0', '2015-03-12 04:00:55', 'multisaitovost_django', 'multi_site_django', 'Мультисайтовость в Django', '', 'Всем привет.\r\nСегодня поговорим про создание мультисайтовых систем.\r\nВозникает вопрос зачем это надо? Например, вы решили сделать сервис, который позволяет создавать лендинг страницы или \r\nинтернет-магазины  наподобие lpgenerator.ru или insales.ru\r\nИсходя из задачи - возникают следующие требования\r\nУ пользователя есть личный кабинет, доступ к которому осуществляется через домен сервиса - например hypershop.ru\r\n\r\nДля своих сайтов пользователь может задать свой домен, но на этапе тестирования должна быть возможность создать тестовый поддомен, например\r\nshop1.hypershop.ru или myshop.hypershop.ru\r\n\r\nОбычно в голову приходит что-то вроде\r\n    \r\n    \r\n    :::python\r\n    class Shop(models.Model):\r\n        user = models.ForeignKey(User, verbose_name=_(\'user\'))\r\n        domain = models.CharField(verbose_name=_(\'domain\'), max_length=255)\r\n        class Meta:\r\n            verbose_name = _(\'shop\')\r\n            verbose_name_plural = _(\'shops\')\r\n            unique_together = \r\n\r\nА дальше уже все что идет у нас вместе с магазином\r\n\r\n    :::python\r\n    class Article(models.Model):\r\n        shop = models.ForeignKey(Shop, verbose_name=_(\'shop\'))\r\n        ...\r\nно я предлагаю забыть про нормализацию и добавить избыточное поле user\r\n\r\n    :::python\r\n    class Article(models.Model):\r\n        user = models.ForeignKey(User, verbose_name=_(\'user\'))\r\n        shop = models.ForeignKey(Shop, verbose_name=_(\'shop))\r\n        ...\r\n        \r\nв дальнейшем это упростит проверку прав и сбор статистики\r\n\r\nЕдем дальше.\r\n\r\nДля того чтобы каждый раз не дергать в коде принадлежность домена повесим все это в middleware\r\nна переменную request - request.shop\r\n\r\n    :::python\r\n    class MiddlewareFilterPersist(object):\r\n        def process_request(self, request):\r\n            try:\r\n                request.shop = Shop.objects.get(domain=request.META[\'HTTP_HOST\'])\r\n            except Exception, e:\r\n                # можно поставить домен по умолчанию\r\n\r\nСобственно, все. Если надо вытащить в шаблоне или вьюхе текущий магазин - обращаемся к request.shop\r\n\r\nУдачи!', '', '1', null, '', 'Сегодня поговорим про создание мультисайтовых систем.\r\nВозникает вопрос зачем это надо? Например, вы решили сделать сервис, который позволяет создавать лендинг страницы или \r\nинтернет-магазины  наподобие lpgenerator.ru или insales.ru', '');
